<!doctype html>
<html>
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width,initial-scale=1">
<title>Sanitized Preview</title>
<style>
:root{color-scheme:dark}
*{box-sizing:border-box;max-width:100%}
html,body{min-height:100%}
body{margin:0;padding:24px;background:#0b0f14;color:#e6f0f1;font:16px system-ui,-apple-system,Segoe UI,Roboto,Ubuntu;line-height:1.55}
a{color:#2ee7d8;text-decoration:none;border-bottom:1px dotted #2ee7d8;word-break:break-word;overflow-wrap:anywhere}
a:hover{text-decoration:underline}
code,kbd,samp,pre{font-family:ui-monospace,SFMono-Regular,Consolas,Monaco,Menlo,monospace}
pre{background:#0f151c;border:1px solid #15202a;border-radius:12px;padding:12px;overflow:auto}
code{background:#0f151c;border:1px solid #15202a;border-radius:8px;padding:2px 6px}
blockquote{margin:12px 0;padding:12px 16px;border-left:3px solid #2ee7d8;background:#0f151c;border-radius:10px}
table{border-collapse:collapse;width:100%;background:#0f151c;border:1px solid #15202a;border-radius:12px;overflow:hidden}
th,td{border-bottom:1px solid #15202a;padding:10px 12px;text-align:left;vertical-align:top}
thead th{background:#101922;font-weight:700}
hr{border:none;border-top:1px solid #15202a;margin:18px 0}
h1,h2,h3,h4,h5,h6{margin:0 0 12px 0;line-height:1.25}
p{margin:0 0 12px 0}
ul,ol{padding-left:22px}
img,video,audio,iframe{display:none!important}
</style>
</head>
<body>
<div id="__content"><html><head>
    
    
  
</head>
  <body>
    <div>
      <div>
        
      </div>
      <div><div role="main"><div></div></div></div>
    </div>
  

</body></html></div>
</body>
</html>
